syntax = "proto2";

package com.market;

option optimize_for = SPEED;
option java_package = "com.binance.ws.messages.protobuf.com.market";
option java_multiple_files = true;
option java_outer_classname = "KycStatusReqProto";

message KycStatusReq {
  optional KycStatusReqType reqType = 1;
}

enum KycStatusReqType{
 V1 = 0;
 V2 = 1;
}